import{_ as e,y as n,x as a,W as s}from"./plugin-vue_export-helper.68280688.js";var t="/assets/Umgebungsvariablen_setzen_1.a469d5ea.png",o="/assets/Umgebungsvariablen_setzen_2.2622ca6b.png",i="/assets/eclipse.ini.0bcd0c78.png",r="/assets/eclipse_json.00f05698.png",p="/assets/eclipse_general_editor.fe6d3e51.png",l="/assets/eclipse_general_workspace.8c8d9ba2.png";const q='{"title":"Systemvoraussetzungen und Installationshinweise","description":"","frontmatter":{},"headers":[{"level":2,"title":"Git Repositories in Eclipse einrichten","slug":"git-repositories-in-eclipse-einrichten"},{"level":3,"title":"Quellen aus GitLab eintragen:","slug":"quellen-aus-gitlab-eintragen"},{"level":2,"title":"Gradle Projekte laden","slug":"gradle-projekte-laden"},{"level":2,"title":"DBeaver","slug":"dbeaver"},{"level":2,"title":"VSCodeUserSetup","slug":"vscodeusersetup"},{"level":2,"title":"git per terminal auf Windows","slug":"git-per-terminal-auf-windows"}],"relativePath":"Entwicklungsumgebungen/Eclipse-Windows/index.md","lastUpdated":1649312336115}',c={},u=s('<h1 id="installation-unter-windows-10-64bit" tabindex="-1"><em><strong>Installation unter Windows 10 64bit</strong></em> <a class="header-anchor" href="#installation-unter-windows-10-64bit" aria-hidden="true">#</a></h1><h1 id="systemvoraussetzungen-und-installationshinweise" tabindex="-1">Systemvoraussetzungen und Installationshinweise <a class="header-anchor" href="#systemvoraussetzungen-und-installationshinweise" aria-hidden="true">#</a></h1><p>Die gesammte Entwicklungsumgebung belegt in etwa 3 GB und sollte auf einem lokalem Laufwerk liegen.</p><h1 id="maria-db-installieren" tabindex="-1">Maria db installieren <a class="header-anchor" href="#maria-db-installieren" aria-hidden="true">#</a></h1><ul><li>download : Maria db 10.6 -&gt; <a href="https://mariadb.org/download/?t=mariadb&amp;p=mariadb&amp;r=10.6.5&amp;os=windows&amp;cpu=x86_64&amp;pkg=msi&amp;m=netcologne" target="_blank" rel="noopener noreferrer">https://mariadb.org/download/?t=mariadb&amp;p=mariadb&amp;r=10.6.5&amp;os=windows&amp;cpu=x86_64&amp;pkg=msi&amp;m=netcologne</a></li><li>root user einrichten</li></ul><h1 id="jdk-17-installieren" tabindex="-1">JDK 17 installieren <a class="header-anchor" href="#jdk-17-installieren" aria-hidden="true">#</a></h1><ul><li>Download des jdk-17 -&gt; <a href="https://download.oracle.com/java/17/latest/jdk-17_windows-x64_bin.zip" target="_blank" rel="noopener noreferrer">https://download.oracle.com/java/17/latest/jdk-17_windows-x64_bin.zip</a></li><li>Entpacken in z.B. D:\\svws_Entwicklungsumgebung\\jdk-17\\</li><li>Path setzen: <ul><li>\xDCber das Windowssymbol den Editor f\xFCr die Umgebungsvariablen \xF6ffnen</li><li>die Variable Path bearbeiten und einen weiteren Eintrag zum Java Verzeichnis einf\xFCgen</li></ul></li></ul><p><img src="'+t+'" alt="Umgebungsvariablen setzen"></p><p><img src="'+o+'" alt="Umgebungsvariablen setzen"></p><h1 id="eclipse-installieren-und-konfigurieren" tabindex="-1">Eclipse installieren und konfigurieren <a class="header-anchor" href="#eclipse-installieren-und-konfigurieren" aria-hidden="true">#</a></h1><ul><li>Installieren eclipse-inst-win64.zip (aktuelle Version) (Eclipse IDE for Java Developers)-&gt; <a href="https://www.eclipse.org/downloads/" target="_blank" rel="noopener noreferrer">https://www.eclipse.org/downloads/</a></li><li>Einmaliger Start Eclipse und festlegen des Workspace: <code>D:\\\\svws_Entwicklungsumgebung\\workspace\\</code></li><li>Bei Bedarf den Speicher hochsetzen: per texteditor <code>D:\\svws_Entwicklungsumgebung\\workspace\\eclipse.ini</code> entsprechend z.B. aus der 512 eine 2048 machen</li></ul><p><img src="'+i+'" alt="Speicher hochsetzen"></p><ul><li>Eclipse &gt; Help &gt; Marcet Place -&gt; JSON editor suchen und &quot;JSON Editor Plugin 1.1.2&quot; installieren</li></ul><p><img src="'+r+'" alt=""></p><ul><li>Eclipse &gt; Window &gt; Preferences &gt; General &gt; Editors &gt; Text Editors &gt; Spelling &gt; UTF-8</li></ul><p><img src="'+p+'" alt=""></p><ul><li>Eclipse &gt; Window &gt; Preferences &gt; General &gt; Workspace &gt; Text file encodig &gt; Other UTF-8</li></ul><p><img src="'+l+`" alt=""></p><h2 id="git-repositories-in-eclipse-einrichten" tabindex="-1">Git Repositories in Eclipse einrichten <a class="header-anchor" href="#git-repositories-in-eclipse-einrichten" aria-hidden="true">#</a></h2><ul><li>Eclipse &gt; Windows &gt; Perspektive &gt; Open Perspective &gt; Other -&gt; Git</li></ul><h3 id="quellen-aus-gitlab-eintragen" tabindex="-1">Quellen aus GitLab eintragen: <a class="header-anchor" href="#quellen-aus-gitlab-eintragen" aria-hidden="true">#</a></h3><ul><li>Repositories in Eclipse clonen: rechte Maustaste Git &gt; Clone a Git Repository</li><li>URL und Passwort eingeben</li></ul><p>Hier ben\xF6tigt man als &quot;Passwort&quot; in Eclipse den pers\xF6nlichen Github Token.</p><ul><li><a href="https://git.svws-nrw.de/SVWS-Server" target="_blank" rel="noopener noreferrer">https://git.svws-nrw.de/SVWS-Server</a> (Mono-Repository mit Core, DB, Client und UI-Components und Apps)</li></ul><p>Anschlie\xDFend git clone ausf\xFChren.</p><h2 id="gradle-projekte-laden" tabindex="-1">Gradle Projekte laden <a class="header-anchor" href="#gradle-projekte-laden" aria-hidden="true">#</a></h2><p>Nun m\xFCssen nur noch in der &quot;gradle perspektive&quot; die im git Verzeichnis liegenden gradle Projekte importiert werden.</p><h4 id="svws-einstellungen" tabindex="-1">SVWS Einstellungen <a class="header-anchor" href="#svws-einstellungen" aria-hidden="true">#</a></h4><p>Die Beispiel-Config ins Zielverzeichnis kopieren und umbenennen.</p><div class="language-"><pre><code> git/SVWS-Swerver/svws-server-app/src/main/resources/svwsconfig.json.example #Zielverzeichnis#/svwsconfig.json
</code></pre></div><p>Beispiel einer svwsconfig.json, bitte die userdaten und Passw\xF6rter entspechend anpassen:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>
<span class="token property">&quot;EnableClientProtection&quot;</span> <span class="token operator">:</span> <span class="token null keyword">null</span><span class="token punctuation">,</span>
<span class="token property">&quot;DisableDBRootAccess&quot;</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
<span class="token property">&quot;DisableAutoUpdates&quot;</span> <span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
<span class="token property">&quot;UseHTTPDefaultv11&quot;</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
<span class="token property">&quot;PortHTTPS&quot;</span><span class="token operator">:</span> <span class="token number">443</span><span class="token punctuation">,</span>
<span class="token property">&quot;UseCORSHeader&quot;</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>
<span class="token property">&quot;ClientPath&quot;</span><span class="token operator">:</span> <span class="token string">&quot;.../git/SVWS-Server/svws-webclient/build/output&quot;</span><span class="token punctuation">,</span>
<span class="token property">&quot;LoggingEnabled&quot;</span><span class="token operator">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>
<span class="token property">&quot;LoggingPath&quot;</span><span class="token operator">:</span> <span class="token string">&quot;logs&quot;</span><span class="token punctuation">,</span>
<span class="token property">&quot;TempPath&quot;</span><span class="token operator">:</span> <span class="token string">&quot;/home/svwsdeveloper/temp&quot;</span><span class="token punctuation">,</span>
<span class="token property">&quot;TLSKeystorePath&quot;</span><span class="token operator">:</span> <span class="token string">&quot;.&quot;</span><span class="token punctuation">,</span>
<span class="token property">&quot;TLSKeystorePassword&quot;</span><span class="token operator">:</span> <span class="token string">&quot;svwskeystore&quot;</span><span class="token punctuation">,</span>
<span class="token property">&quot;DBKonfiguration&quot;</span><span class="token operator">:</span> <span class="token punctuation">{</span>
	<span class="token property">&quot;dbms&quot;</span><span class="token operator">:</span> <span class="token string">&quot;MARIA_DB&quot;</span><span class="token punctuation">,</span>
	<span class="token property">&quot;location&quot;</span><span class="token operator">:</span> <span class="token string">&quot;localhost&quot;</span><span class="token punctuation">,</span>
	<span class="token property">&quot;SchemaKonfiguration&quot;</span><span class="token operator">:</span> <span class="token punctuation">[</span>
		<span class="token punctuation">{</span>
		<span class="token property">&quot;name&quot;</span><span class="token operator">:</span> <span class="token string">&quot;schildtest&quot;</span><span class="token punctuation">,</span>
		<span class="token property">&quot;svwslogin&quot;</span><span class="token operator">:</span> <span class="token boolean">false</span><span class="token punctuation">,</span>
		<span class="token property">&quot;username&quot;</span><span class="token operator">:</span> <span class="token string">&quot;svwsadmin&quot;</span><span class="token punctuation">,</span>
		<span class="token property">&quot;password&quot;</span><span class="token operator">:</span> <span class="token string">&quot;svwsadmin&quot;</span>
		<span class="token punctuation">}</span>
		<span class="token punctuation">]</span>
	<span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><h1 id="optionale-software" tabindex="-1">Optionale Software <a class="header-anchor" href="#optionale-software" aria-hidden="true">#</a></h1><h2 id="dbeaver" tabindex="-1">DBeaver <a class="header-anchor" href="#dbeaver" aria-hidden="true">#</a></h2><ul><li>download: <a href="https://dbeaver.io/download/" target="_blank" rel="noopener noreferrer">https://dbeaver.io/download/</a></li></ul><h2 id="vscodeusersetup" tabindex="-1">VSCodeUserSetup <a class="header-anchor" href="#vscodeusersetup" aria-hidden="true">#</a></h2><ul><li>Install VSCodeUserSetup-x64-latest.exe (optional)</li></ul><h2 id="git-per-terminal-auf-windows" tabindex="-1">git per terminal auf Windows <a class="header-anchor" href="#git-per-terminal-auf-windows" aria-hidden="true">#</a></h2><ul><li>Ohne Administrationsrechte installierbar</li><li>hier die Anleitung auf <a href="http://heise.de" target="_blank" rel="noopener noreferrer">heise.de</a> -&gt; <a href="https://www.heise.de/tipps-tricks/Git-auf-Windows-installieren-und-einrichten-5046134.html" target="_blank" rel="noopener noreferrer">https://www.heise.de/tipps-tricks/Git-auf-Windows-installieren-und-einrichten-5046134.html</a></li><li>download: <a href="https://git-scm.com/download/win" target="_blank" rel="noopener noreferrer">https://git-scm.com/download/win</a></li><li>Im MSB noch den Proxy eintragen: git config --global http.proxy <a href="http://10.64.128.22:3128" target="_blank" rel="noopener noreferrer">http://10.64.128.22:3128</a></li></ul><h1 id="installation-in-einer-proxy-umgebun" tabindex="-1">Installation in einer Proxy-Umgebun <a class="header-anchor" href="#installation-in-einer-proxy-umgebun" aria-hidden="true">#</a></h1><div class="language-"><pre><code>Eclipse &gt; Windows &gt; Preferences &gt; General &gt; Network Connection
</code></pre></div><p>den Http und den Https-Proxy eintragen. (Sollte er automatisch finden, wenn konfiguriert.)</p><p>Powershell \xF6ffnen im Ordner SVWS-Server Proxy Config f\xFCr NodeJS</p><div class="language-shell"><pre><code>		<span class="token function">npm</span> config <span class="token builtin class-name">set</span> proxy http://proxy.company.com:8080
		<span class="token function">npm</span> config <span class="token builtin class-name">set</span> https-proxy http://proxy.company.com:8080
</code></pre></div>`,44),d=[u];function g(h,k,m,w,b,f){return a(),n("div",null,d)}var _=e(c,[["render",g]]);export{q as __pageData,_ as default};
